import React from "react";
import {BrowserRouter as Router, Route, Link} from "react-router-dom";
import "./LogIn.css";

class LogIn extends React.Component {
  render() {
    return (
      <div id="content">
        <form>
          <div id="id">
            <input type="text" id="id" placeholder="아이디를 입력하세요." />
          </div>

          <div id="pw">
            <input
              type="password"
              id="pw"
              placeholder="비밀번호를 입력하세요."
            />
          </div>

          <div id="middle">
            
            <button id="login" onClick={console.log("")}>로그인</button>
            <hr style={{marginBottom: "2%", width: "26%"}} />
          </div>

          <div id="Btn">
            <input type="submit" id="idSearchBtn" Value="아이디 찾기" />

            <input type="submit" id="pwSearchBtn" Value="비밀번호 찾기" />

            <input type="submit" id="signUpBtn" Value="회원가입" />
          </div>
        </form>
      </div>
    );
  }
}

export default LogIn;
